sys_variable_value.value:
(function execute(inputs, outputs) {
  outputs.payload = {};

  chksumLen = inputs.checksums.length;
  outputs.payload.checksums = [];
  for(var i = 0; i < chksumLen; i++) {
    outputs.payload.checksums[i] = inputs.checksums[i];
  }

  pathsLen = inputs.paths.length; 
  outputs.payload.paths = [];
  for(var i = 0; i < pathsLen; i++) {
    outputs.payload.paths[i] = inputs.paths[i];
  }
})(inputs, outputs);

